  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108060 includes chemical,
  discrete sample, physical and profile data collected from KNORR in the Caribbean
  Sea and North Atlantic Ocean from 2003-09-22 to 2003-11-13 and retrieved during
  cruise (KN173/1), (KN173/2), 316N20030922 and 316N20031023. These data include ALKALINITY,
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), Carbon tetrachloride (CCL4), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3,
  DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM,
  HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta),
  SALINITY, SILICATE, TRITIUM, Total Dissolved Nitrogen (TDN) and WATER TEMPERATURE.
  The instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Frank J. Millero of
  Rosenstiel School of Marine and Atmospheric Science, Andrew Dickson of Scripps Institution
  of Oceanography and Richard A. Feely and Christopher Sabine of US DOC; NOAA; OAR;
  Pacific Marine Environmental Laboratory as part of the CLIVAR_A20_2003, CARINA/316N20030922
  and CLIVAR_A22_2003, CARINA/316N20031023 data set.nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
